function TeamListComponent({ history }) {
  const dispatch = useDispatch();
  useEffect(() => {
    dispatch(getMyTeamsAction());
  }, [dispatch]);
  const { loading, error, teams } = useSelector(
    (state) => state.teamsSection?.myteams
  );
  return (
    <>
      <Loader loading={loading} />
      <Paper
        elevation={3}
        sx={{
          padding: 2,
          height: "80vh",
          overflowY: "scroll",
        }}
      >
        <Typography variant="h5" component="h6">
          Teams
        </Typography>
        <Box sx={{ my: 2 }}></Box>
        {teams?.map((team) => (
          <TeamListCard
            key={team._id}
            teamId={team.teamId}
            teamName={team.teamName}
            history={history}
          />
        ))}
      </Paper>
    </>
  );
}

function TeamListCard({ teamId, teamName, history }) {
  const openTeamHandler = () => {
    history.push(`/myTeams/${teamId}`);
  };
  return (
    <Paper
      elevation={2}
      sx={{
        padding: 1,
        my: 2,
        "&:hover": {
          backgroundColor: "#e3e3e3",
          cursor: "pointer",
        },
      }}
      onClick={openTeamHandler}
    >
      <Typography variant="h6" component="h6">
        {teamName}
      </Typography>
      {/* <Typography variant="caption" component="div">
        Veeresh : Hey there, wh....
      </Typography> */}
    </Paper>
  );
}
